// LOGIN LOGIC GOES HERE.
// Notes:
//   - Rename Login.js based on naming conventions after it is decided on (i.e. capitalizations for styles, main, and js files)
//   - Don't put everything in one file. Seperate into:
//       - Styles
//       - Logic (Main .js file)
//       - APIs (Accessory .js files)
import React from 'react';
import {
  SafeAreaView,
  ScrollView,
  View,
  Text,
  TextInput,
  TouchableOpacity,
  Image,
  StyleSheet
} from 'react-native';

const LoginScreen = () => {
  return (
    <SafeAreaView style={styles.container}>
      <ScrollView style={styles.scrollView} contentContainerStyle={{ alignItems: 'center' }}>
        {/* Top Row for Status Bar Icons */}
        <View style={styles.row}>
          <Text style={styles.text}>{"9:41"}</Text>
          <Image source={{ uri: "https://i.imgur.com/1tMFzp8.png" }} resizeMode="stretch" style={styles.image} />
          <Image source={{ uri: "https://i.imgur.com/1tMFzp8.png" }} resizeMode="stretch" style={styles.image2} />
          <Image source={{ uri: "https://i.imgur.com/1tMFzp8.png" }} resizeMode="stretch" style={styles.image3} />
        </View>

        {/* Main Login Content */}
        <View style={styles.column}>
          {/* Logo */}
          <Image source={{ uri: "https://i.imgur.com/1tMFzp8.png" }} resizeMode="stretch" style={styles.image5} />

          {/* Email Input */}
          <Text style={styles.text2}>Email or Username</Text>
          <TextInput style={styles.box} placeholder="Enter Email or Username" />

          {/* Password Input */}
          <Text style={styles.text3}>Password</Text>
          <TextInput style={styles.box2} placeholder="Enter Password" secureTextEntry />

          {/* Sign In Button */}
          <TouchableOpacity style={styles.view}>
            <Text style={styles.text4}>Sign In</Text>
          </TouchableOpacity>

          {/* OR Divider */}
          <View style={styles.row2}>
            <View style={styles.box3} />
            <Text style={styles.text5}>OR</Text>
            <View style={styles.box3} />
          </View>

          {/* Social Login Buttons */}
          <TouchableOpacity style={styles.row3}>
            <Image source={{ uri: "https://i.imgur.com/1tMFzp8.png" }} resizeMode="stretch" style={styles.image6} />
            <Text style={styles.text6}>Sign in with Google</Text>
          </TouchableOpacity>

          <TouchableOpacity style={styles.row4}>
            <Image source={{ uri: "https://i.imgur.com/1tMFzp8.png" }} resizeMode="stretch" style={styles.image7} />
            <Text style={styles.text6}>Sign in with Facebook</Text>
          </TouchableOpacity>

          {/* Sign Up Link */}
          <Text style={styles.text7}>
            Need an account? <Text style={styles.signupLink}>Create your account</Text>
          </Text>
        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#FF957C",
  },
  scrollView: {
    flex: 1,
    paddingTop: 16,
  },
  row: {
    flexDirection: "row",
    alignItems: "center",
    marginBottom: 45,
    marginLeft: 38,
  },
  column: {
    backgroundColor: "#FFFFFF",
    borderRadius: 12,
    paddingTop: 13,
    paddingBottom: 35,
    paddingHorizontal: 23,
    width: '90%',
  },
  text: {
    color: "#FFFFFF",
    fontSize: 16,
    marginRight: 4,
  },
  text2: {
    color: "#757575",
    fontSize: 16,
    marginBottom: 8,
  },
  text3: {
    color: "#898989",
    fontSize: 16,
    marginBottom: 7,
  },
  text4: {
    color: "#FFFFFF",
    fontSize: 24,
  },
  text5: {
    color: "#34CC99",
    fontSize: 20,
  },
  text6: {
    color: "#757575",
    fontSize: 14,
  },
  text7: {
    fontSize: 10,
    textAlign: 'center',
    marginTop: 20,
  },
  signupLink: {
    color: '#34CC99',
  },
  box: {
    height: 40,
    borderBottomWidth: 1,
    borderBottomColor: "#34CC99",
    marginBottom: 30,
  },
  box2: {
    height: 40,
    borderBottomWidth: 1,
    borderBottomColor: "#34CC99",
    marginBottom: 40,
  },
  box3: {
    width: 100,
    height: 1,
    backgroundColor: "#34CC99",
  },
  image: { width: 18, height: 10, marginRight: 5 },
  image2: { width: 15, height: 10, marginRight: 5 },
  image3: { width: 26, height: 13 },
  image5: { height: 124, marginBottom: 76 },
  image6: { width: 17, height: 17, marginRight: 10 },
  image7: { width: 17, height: 17, marginRight: 10 },
  view: {
    alignItems: "center",
    backgroundColor: "#34CC99",
    borderRadius: 58,
    paddingVertical: 14,
    marginBottom: 34,
  },
  row2: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
    marginBottom: 29,
  },
  row3: {
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#FFFFFF",
    borderColor: "#B3B3B3",
    borderRadius: 58,
    borderWidth: 1,
    paddingVertical: 13,
    marginBottom: 21,
  },
  row4: {
    flexDirection: "row",
    justifyContent: "center",
    alignItems: "center",
    backgroundColor: "#FFFFFF",
    borderColor: "#B3B3B3",
    borderRadius: 58,
    borderWidth: 1,
    paddingVertical: 12,
  },
});

export default LoginScreen;
